static inline uint gb4lin_to_gb(uint gb4lin) {
    uchar   a, b, c, d;
    a = 0x81 + gb4lin / 12600;
    b = 0x30 + (gb4lin / 1260) % 10;
    c = 0x81 + (gb4lin / 10) % 126;
    d = 0x30 + gb4lin % 10;
    return ((a << 24) | (b << 16) | (c << 8) | d);
}

